import { Form, FormLabel } from "react-bootstrap";

import "./SignUp.css";

const SignUp = () => {
  return (
    <Form className="content">
      <FormLabel>First Name</FormLabel>
      <Form.Control
        type="text"
        name="First Name"
        placeHolder="Please fill your first name"
        // ref={register({ required: "Required" })}
      />
    </Form>
  );
};
export default SignUp;
